widgets_values:
* {
    font-family: arial;
}

.startPage {
    position: absolute;
    width: 360px;
    height: 375px;
    z-index: 0;
    transition: transform 0.3s ease;
}
.startPage:hover {
    transform: translateY(-3%);
}
.classnew {
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    margin-top: 24px;
    margin-bottom: 24px;
}

.hoverContainer :last-child {
    margin-bottom: 0px;
}

.hoverContainer {
    background: black;
    border-radius: 24px;
    padding: 18px;
    display: flex;
    flex-direction: column;
    align-items: flex-start;
    justify-content: flex-start;
    align-self: stretch;
    flex-shrink: 0;
    height: fit-content;
    max-width: 336px;
    position: relative;
    margin-bottom: 12px;
    left: 50%;
    height: min-content;
    top: 50%;
    transform: translate(-50%, -50%);

}

.header_discrip {
    font-size: 21px;
    font-weight: 200;
    color: #6f6f6f;
    width: fit-content;
}

.h1 {
    font-size: 38px;
    margin: 12px 0px;
    font-weight: 700;
    text-align: center;
}

.size-smallButton {
    font-size:21px;
    border-radius: 12px;
    height: 48px;
    min-width: 48px;
    display: flex;
    align-items: center;
    width: 93%;
    margin-top: 12px;
    justify-content: center;
    cursor: pointer;
}

.style-input {
    background: #2a2a2b;
    border-radius: 12px;
    padding: 12px;
}

.style-input:hover {
    background: #3b3b3c;
}

.header {
    padding-bottom: 12px;
    margin-bottom: 12px;
    border-bottom: 1px solid #3e3e3e;
    width: 100%;
    height: 36px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    flex-direction: row;
}

a {
    width: 100%;
    color: #B6B6B7;
    
}

a:hover,
a:hover .header_discrip {
    color: #DDDDDD !important;
}

