}

.profile-name {
   
    color: #d4d4d4;
    margin-bottom: 8px;
    font-size: 16px;
}

.subscribe-button {
    font-size:12px;
    padding: 12px;
    width: 96px;
    background-color: black;
    color: #fff;
    text-decoration: none;
    border-radius: 8px;
    font-weight: bold;
       transition: transform 0.3s ease;
}

.subscribe-button:hover {
    transform: translateY(-3px);
    background-color: #a00000;
}

